import React from "react";
import { Container, View, Text } from '../../atoms'

const Footer = ({props}) => {

    return (
        <Container 
        isEqualHeight="80vh"
        justifyContent="center"
        alignItems="center"
        >
            <View>
                <Text>Footer</Text>
            </View>
        </Container>
    )
}

export default Footer
